								<p>The NSW or New South Wales Skilled Occupation List 2019  is revised on the command of New Wales Department of Industry based on the requirement and availability of occupational skills under Subclass 190 and Subclass 489 visa. Deciding the occupations on this list, NSW uses Commonwealth and state employment data, as well as evidence, supported feedback from NSW industry.</p>

