<p>In determining the occupations on the priority list, the state uses Commonwealth and State employment data as well as evidence-supported feedback from NSW industry.</p>

<p>The occupations on these lists are selected to meet the skill needs of the NSW economy. The lists are updated from time to time according to the skills needs in the region. In addition, there are the limited number of invitations to certain occupations to ensure that places allocated under the  9  programs are in line with the skills needs of NSW. The highest-ranking candidates  will be invited first.</p>



<h5 class="pt-5 pb-3">Skilled nominated visa subclass  9 </h5>
<p>Qualified candidates who want to live and work in Australia as a permanent resident and are being nominated by the state and territory government can apply for Skilled Nominated Visa Subclass  9 .</p>

<p>Successful aspirants can live and work in state for at least two years on the subclass  9  visa. The NSW  9  priority occupation list  includes the priority occupations that NSW will invite for the nomination under the nominated visa  9 .</p>

<p>For State Nomination, the occupations on the Priority Skilled Occupation list can be taken for nomination which contributes an additional five points towards the candidate’s overall score on the Australian immigration points calculator 2  9 for visa application process. The highest-ranking applicants on the New Wales  9  priority skilled occupation list will be invited first. Under subclass  9 , candidates can also go for combined list of eligible skilled occupation list ( MLTSSL and STSOL).</p>

<h5 class="pt-5 pb-3"> Skilled regional nominated migration subclass 489</h5>
<p>The skilled regional nominated migration 489 is a provisional visa that allows to live and work in NSW region of Australia for up to four years. If the candidate works in state for at least one year and live in for at least two years then, he/she can be eligible for permanent visa. Under subclass 489, candidates can check list of eligible occupations and can choose their nominated occupation. The NSW 489 occupation list comprises of the occupation that are appropriate for NSW nomination for the Regional Nomination Visa Subclass 489.</p>

<p>Candidates seeking NSW nomination for skilled regional migration (489) should contact the NSW region that they are interested in.</p>

